import '../footer.css'

function FooterMiddle() {



    return (
            <div id="footer-middle">
                <div id="footer-links">
                    <div>
                <a href="https://www.lanacion.com.ar/"><span class="footer-link">Mapa del sitio</span></a>
                <a href="https://www.lanacion.com.ar/"><span class="footer-link">Ayuda</span></a>
                <a href="https://www.lanacion.com.ar/"><span class="footer-link">Términos y condiciones</span></a>
                <a href="https://www.lanacion.com.ar/"><span class="footer-link">¿Cómo anunciar?</span></a>
                <a href="https://www.lanacion.com.ar/"><span class="footer-link">Suscribirse al diario impreso</span></a>





                    </div>
                </div>
                <div></div>
            </div>
    )
}


export default FooterMiddle;
